INSERT INTO `jena_long_lit` VALUES (1,'Lv:0::This property can be used to describe the object.  The value of this property will appear at :',1775438341,'the top of the page, above the triple table.'),(2,'Lv:0::A property type indicates what type of values instances of the property can have.  Examples w:',4262683234,'ould be: any instance which is a typeof type, string, number, etc.'),(3,'Lv:0::indentifies the interface to use to input the value for a property.  A common value is sugges:',3648726161,'t which displays the names of objects which fit the types listed under that object\'s property type.  There is also currently plain and textarea.'),(4,'Lv:0::Somehow select a set of objects and:\n\n* delete all of their descriptions\n* change all of thei:',4173205881,'r priorities to 3\n* delete all of them\n* add property, value pair'),(5,'Lv:0::Somehow select a set of objects and:\n\n* delete all of their descriptions\n* change all of thei:',3484289432,'r priorities to 3\n* delete all of them\n* add property, value pair\n\n'),(6,'Lv:0::For now, tags can only be strings.  It might be interesting at some point to allow tagging th:',2312899940,'ings with other more complex objects.'),(7,'Lv:0::The Burning Kumquat is amazing!  Maybe the mission statement goes here?\n\nDoes editing actuall:',2896017237,'y work?'),(8,'Lv:0::The Burning Kumquat is amazing!  Maybe the mission statement goes here?\n\n* item 1\n* item 2\n* :',4106789832,'item 3'),(9,'Lv:0::At a Glance\n\nFounded by a group of students in the fall of 2007, the Burning Kumquat is a low:',409955953,'-impact, intensive garden on the campus of Washington University in St. Louis. The Burning Kumquat is joining a number of urban and campus farms in raising consciousness of community, food, and environmental issues.\n\n### Mission\n\nOur purpose is to empower each other with the shared experience of practicing sustainable urban agriculture. The farm is a place where Washington University (Wash U) and the surrounding community can reconnect with and care for the land. Through the work and joy of growing food, we hope to inspire responsible food practices and to provide local produce in our community.\n\n### Site\n\nThe Burning Kumquat is located on the residential campus of Wash U, near the intersection of Forsyth Boulevard and Wallace Drive. Approximately 7840 square feet, the site includes 17 raised beds, compost piles, a drip irrigation system, and stations to process and refrigerate produce. The farm uses natural fertilizers such as fish emulsion and compost.\n\n### Support\n\nThe Burning Kumquat received start-up funds from the Wash Us Campus Enrichment Fund through Student Union. The farm is recognized as a community garden by Gateway Greening, which provided a grant that paid for the majority of its soil. The farm started its seeds in the Jeanette Goldfarb Plant Growth Facility at Wash U. The Burning Kumquat appreciates the support and advice it has received along the way, especially from faculty at Wash U and friends at New Roots Urban Farm.\n\n### Crops\n\nThe Burning Kumquat grows a variety of produce from seed, such as basil, corn, okra, strawberries,tomatoes, peppers and cucumbers. The first harvest yielded radishes, lettuce, and snow peas.\n\n### Market\n\nDuring the summer, the farm sells at the North City Market in St. Louis and will sell on the Wash U campus during the school year.\n\n### Get Involved\n\nAnyone can join the mailing list to hear about upcoming events by emailing theburningkumquat@gmail.com. Anyone is invited to come to weekly workdays at the farmFridays, 8 a.m. June - August & Saturdays and 9 a.m. September - May. Wash U students are welcome to come to weekly Tuesday meetings.'),(10,'Lv:0::### At a Glance\n\nFounded by a group of students in the fall of 2007, the Burning Kumquat is a:',3941409975,' low-impact, intensive garden on the campus of Washington University in St. Louis. The Burning Kumquat is joining a number of urban and campus farms in raising consciousness of community, food, and environmental issues.\n\n### Mission\n\nOur purpose is to empower each other with the shared experience of practicing sustainable urban agriculture. The farm is a place where Washington University (Wash U) and the surrounding community can reconnect with and care for the land. Through the work and joy of growing food, we hope to inspire responsible food practices and to provide local produce in our community.\n\n### Site\n\nThe Burning Kumquat is located on the residential campus of Wash U, near the intersection of Forsyth Boulevard and Wallace Drive. Approximately 7840 square feet, the site includes 17 raised beds, compost piles, a drip irrigation system, and stations to process and refrigerate produce. The farm uses natural fertilizers such as fish emulsion and compost.\n\n### Support\n\nThe Burning Kumquat received start-up funds from the Wash U\'s Campus Enrichment Fund through Student Union. The farm is recognized as a community garden by Gateway Greening, which provided a grant that paid for the majority of its soil. The farm started its seeds in the Jeanette Goldfarb Plant Growth Facility at Wash U. The Burning Kumquat appreciates the support and advice it has received along the way, especially from faculty at Wash U and friends at New Roots Urban Farm.\n\n### Crops\n\nThe Burning Kumquat grows a variety of produce from seed, such as basil, corn, okra, strawberries,tomatoes, peppers and cucumbers. The first harvest yielded radishes, lettuce, and snow peas.\n\n### Market\n\nDuring the summer, the farm sells at the North City Market in St. Louis and will sell on the Wash U campus during the school year.\n\n### Get Involved\n\nAnyone can join the mailing list to hear about upcoming events by emailing theburningkumquat@gmail.com. Anyone is invited to come to weekly workdays at the farm.\n\n* Fridays, 8 a.m. June - August\n* Saturdays and 9 a.m. September - May\n\nWash U students are welcome to come to weekly Tuesday meetings.'),(11,'Lv:0::At a Glance\n\nFounded by a group of students in the fall of 2007, the Burning Kumquat is a low:',3762832120,'-impact, intensive garden on the campus of Washington University in St. Louis. The Burning Kumquat is joining a number of urban and campus farms in raising consciousness of community, food, and environmental issues.\n\n### Mission\n\nOur purpose is to empower each other with the shared experience of practicing sustainable urban agriculture. The farm is a place where Washington University (Wash U) and the surrounding community can reconnect with and care for the land. Through the work and joy of growing food, we hope to inspire responsible food practices and to provide local produce in our community.\n\n### Site\n\nThe Burning Kumquat is located on the residential campus of Wash U, near the intersection of Forsyth Boulevard and Wallace Drive. Approximately 7840 square feet, the site includes 17 raised beds, compost piles, a drip irrigation system, and stations to process and refrigerate produce. The farm uses natural fertilizers such as fish emulsion and compost.\n\n### Support\n\nThe Burning Kumquat received start-up funds from the Wash U\'s Campus Enrichment Fund through Student Union. The farm is recognized as a community garden by Gateway Greening, which provided a grant that paid for the majority of its soil. The farm started its seeds in the Jeanette Goldfarb Plant Growth Facility at Wash U. The Burning Kumquat appreciates the support and advice it has received along the way, especially from faculty at Wash U and friends at New Roots Urban Farm.\n\n### Crops\n\nThe Burning Kumquat grows a variety of produce from seed, such as basil, corn, okra, strawberries,tomatoes, peppers and cucumbers. The first harvest yielded radishes, lettuce, and snow peas.\n\n### Market\n\nDuring the summer, the farm sells at the North City Market in St. Louis and will sell on the Wash U campus during the school year.\n\n### Get Involved\n\nAnyone can join the mailing list to hear about upcoming events by emailing theburningkumquat@gmail.com. Anyone is invited to come to weekly workdays at the farm: Fridays, 8 a.m. June - August & Saturdays and 9 a.m. September - May. Wash U students are welcome to come to weekly Tuesday meetings.'),(12,'Lv:0::keep track of changes, ideally in a way that could be used to revert back to a previous point:',2241983043,' in time.  Works the same with the wiki'),(13,'Lv:0::how do permissions work?\n\ncould:\n\n* + entire object read/write permissions (like linux)\n    *:',3355911449,' for now this one makes the most sense ... can be expanded later\n    * essentially the same as freebase\n* each triple read/write permissions\n* everyone can read/write their own version\n    * select which aggregate you would like to view\n    * each aggregate could be hand selected or generated via an algorithm\n    * still need to decide on the version that each person sees by default on their first view\n'),(14,'Lv:0::how do permissions work?\n\ncould:\n\n* -> entire object read/write permissions (like linux)\n    :',2508457766,'* for now this one makes the most sense ... can be expanded later\n    * essentially the same as freebase\n* each triple read/write permissions\n* everyone can read/write their own version\n    * select which aggregate you would like to view\n    * each aggregate could be hand selected or generated via an algorithm\n    * still need to decide on the version that each person sees by default on their first view'),(15,'Lv:0::(bug tracking system) is there a nice way in the schema to implement messages left on a bug f:',3001847890,'rom various users, making various changes, etc?'),(16,'Lv:0::for a theoretical bug tracking system is there a nice way in the schema to implement messages:',220290172,' left on a bug from various users, making various changes, etc');
